import React, { useState, useEffect } from 'react';
import API from '../services/api';
import { useNavigate } from 'react-router-dom';
import Input from '../components/Input';

export default function Setup() {
  const [profile, setProfile] = useState({ name: '', bio: '', stylePreferences: [], avatarUrl: '' });
  const [tagInput, setTagInput] = useState('');
  const [error, setError] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    (async () => {
      try {
        const res = await API.get('/profile/me');
        setProfile({
          name: res.data.name || '',
          bio: res.data.bio || '',
          stylePreferences: res.data.stylePreferences || [],
          avatarUrl: res.data.avatarUrl || ''
        });
      } catch (err) {
        console.error(err);
      }
    })();
  }, []);

  const addTag = () => {
    if (tagInput.trim()) {
      setProfile(prev => ({ ...prev, stylePreferences: [...prev.stylePreferences, tagInput.trim()] }));
      setTagInput('');
    }
  };

  const removeTag = (idx) => {
    setProfile(prev => ({ ...prev, stylePreferences: prev.stylePreferences.filter((_, i) => i !== idx) }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    try {
      await API.put('/profile', profile);
      navigate('/profile');
    } catch (err) {
      setError(err.response?.data?.message || 'Update failed');
    }
  };

  return (
    <div className="container-xl py-12">
      <div className="max-w-2xl mx-auto bg-white p-8 rounded-xl shadow">
        <h2 className="text-xl font-semibold mb-4">Setup your profile</h2>
        {error && <div className="text-red-600 mb-3">{error}</div>}
        <form onSubmit={handleSubmit}>
          <Input label="Full name" name="name" value={profile.name} onChange={(e)=>setProfile({...profile, name: e.target.value})} />
          <div className="mb-4">
            <label className="block mb-1 text-sm font-medium">Bio</label>
            <textarea className="w-full p-3 border rounded" value={profile.bio} onChange={(e)=>setProfile({...profile, bio: e.target.value})} />
          </div>

          <div className="mb-4">
            <label className="block mb-1 text-sm font-medium">Style preferences</label>
            <div className="flex gap-2 mb-2">
              <input value={tagInput} onChange={e => setTagInput(e.target.value)} className="flex-1 px-3 py-2 border rounded" placeholder="e.g., minimal, vibrant" />
              <button type="button" onClick={addTag} className="px-4 py-2 bg-indigo-600 text-white rounded">Add</button>
            </div>
            <div className="flex flex-wrap gap-2">
              {profile.stylePreferences.map((t, idx) => (
                <div key={idx} className="px-3 py-1 bg-gray-100 rounded-full flex items-center gap-2">
                  <span>{t}</span>
                  <button type="button" onClick={()=>removeTag(idx)} className="text-sm text-red-500">x</button>
                </div>
              ))}
            </div>
          </div>

          <Input label="Avatar URL" name="avatarUrl" value={profile.avatarUrl} onChange={(e)=>setProfile({...profile, avatarUrl: e.target.value})} />
          <button className="py-2 px-4 bg-green-600 text-white rounded">Save & Continue</button>
        </form>
      </div>
    </div>
  );
}
